// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

interface DaiToken {
    function transfer(address destination, uint ammount) external returns (bool);
    function balanceOf(address owner) external view returns (uint);
}

contract DAI{
    DaiToken public daiToken;
    address payable public owner;

    constructor(){
        owner = payable(msg.sender);
        daiToken = DaiToken(0x5592EC0cfb4dbc12D3aB100b257153436a1f0FEa);
    }

    modifier onlyOwner{
        require (msg.sender == owner, "You are not the owner!");
        _;
    }

    function withdraw(uint amount) public {
        //require (amount <= 0.1 ether);
        require (daiToken.balanceOf(address(this)) >= amount);
        daiToken.transfer(msg.sender, amount);
    }

    receive () external payable{}

    function getBalance(address owner) public view returns (uint){
        return daiToken.balanceOf(owner);
    }

    function destroy() public onlyOwner{
        daiToken.transfer(owner, daiToken.balanceOf(address(this)));
        selfdestruct(owner);
    }
}

